import React from 'react';
import '../styles/Homepage.css';
import homepagepic from '../assets/homepage-pic.svg'

const HomePage = () => {
    return (
        <div className="homepage-container">
            <img src={homepagepic}></img>
        </div>
    );
};

export default HomePage;
